import React from "react";

const General = (props) => {
	return (
		<div>
			<h2>General Info</h2>
			<div>
				<p>{props.name}</p>
				<p>Phone: {props.phone}</p>
				<p>Email: {props.email}</p>
				<button onClick={props.func}>Edit</button>
			</div>
		</div>
	);
};

